function getStyleCharacteristics(styleId) {
    switch(styleId){
        case 'sketch':
            return [
                'Freehand appearance',
                'Line variations',
                'Raw and unfinished look',
                'Popular for artistic tattoo ideas'
            ];
        case 'realistic':
            return [
                'Photorealistic details',
                'Precise shading',
                'Dimensional appearance',
                'Ideal for portrait and animal tattoos'
            ];
        case 'minimalist':
            return [
                'Clean lines',
                'Simple designs',
                'Often monochromatic',
                'Perfect for small hand tattoos'
            ];
        case 'blackAndWhite':
            return [
                'High contrast',
                'Strong black lines',
                'Grey shading',
                'Classic and timeless'
            ];
        case 'surreal':
            return [
                'Dreamlike imagery',
                'Fantastical elements',
                'Imaginative concepts',
                'Unique and artistic'
            ];
        case 'geometric':
            return [
                'Clean shapes',
                'Mathematical precision',
                'Symmetrical patterns',
                'Modern and structured'
            ];
        case 'blackwork':
            return [
                'Bold black designs',
                'Solid ink coverage',
                'Strong visual impact',
                'Tribal and abstract styles'
            ];
        case 'japanese':
            return [
                'Vibrant colors',
                'Traditional motifs',
                'Storytelling elements',
                'Cultural significance'
            ];
        case 'oldSchool':
            return [
                'Bold outlines',
                'Limited color palette',
                'Classic symbols',
                'Traditional American style'
            ];
        case 'cartoon':
            return [
                'Whimsical designs',
                'Vibrant colors',
                'Exaggerated features',
                'Playful and fun'
            ];
        case 'watercolor':
            return [
                'Soft color transitions',
                'Flowing designs',
                'Painterly effects',
                'Artistic and expressive'
            ];
        case 'dotwork':
            return [
                'Tiny dot patterns',
                'Textured shading',
                'Intricate details',
                'Unique visual effects'
            ];
        case 'tribal':
            return [
                'Black geometric patterns',
                'Cultural significance',
                'Bold designs',
                'Traditional origins'
            ];
        case 'abstract':
            return [
                'Non-representational',
                'Emotional expression',
                'Unique interpretations',
                'Modern art style'
            ];
        case 'negativeSpace':
            return [
                'Skin as design element',
                'Contrast effects',
                'Minimal ink usage',
                'Creative use of space'
            ];
        case 'lettering':
            return [
                'Text-based designs',
                'Various fonts',
                'Personal messages',
                'Typography focus'
            ];
        case 'biomechanical':
            return [
                'Mechanical elements',
                'Anatomical fusion',
                'Sci-fi aesthetic',
                'Detailed complexity'
            ];
        case 'portrait':
            return [
                'Realistic faces',
                'Detailed features',
                'Emotional expression',
                'High skill requirement'
            ];
        case '3d':
            return [
                'Depth illusion',
                'Realistic appearance',
                'Dimensional effects',
                'Modern technique'
            ];
        default:
            return [
                'Unique style',
                'Custom design',
                'Personal expression',
                'Artistic freedom'
            ];
    }
}
